import React from "react";
import {
    Image,
    TouchableOpacity,
    Text
} from 'react-native';
import { createStackNavigator } from "@react-navigation/stack";
import { NavigationContainer, DefaultTheme } from "@react-navigation/native";

// screens
import { Onboarding, DestinationDetail, LoginAs, SignUp, Lawyer,Cl_Cases,Cl_Review,
     Cl_Chat, Cl_Reminder, Cl_Profile, Cl_Hearings, Cl_Dictionary, Cl_Lawyer, Login,
     Client , Cases, Lw_Cases, Lw_Requests, Lw_Profile, Lw_Reminder} from "./screens/";

// extra screens
import Tabs from "./navigation/tabs";

import { icons, COLORS, SIZES, FONTS } from './constants';
import { useFonts } from 'expo-font';

const theme = {
    ...DefaultTheme,
    colors: {
        ...DefaultTheme.colors,
        border: "transparent",
    },
};

const Stack = createStackNavigator();

const App = () => {
    const [loaded] = useFonts({
        "Roboto-Black": require('./assets/fonts/Roboto-Black.ttf'),
        "Roboto-Bold": require('./assets/fonts/Roboto-Bold.ttf'),
        "Roboto-Regular": require('./assets/fonts/Roboto-Regular.ttf'),

    })

    if (!loaded) {
        return null;
    }
    return (
        <NavigationContainer theme={theme}>
            <Stack.Navigator
                initialRouteName={'.Express_Backend/app.js'}
 //               initialRouteName={'Onboarding'}
            >
                {/* Screens */}
                <Stack.Screen
                    name="Onboarding"
                    component={Onboarding}
                    options={{
                        title: null,
                        headerStyle: {
                            backgroundColor: '#003f5c'
                        },
                        headerLeft: null,
                        headerRight: () => (
                            <TouchableOpacity
                                style={{ marginRight: SIZES.padding }}
                                onPress={() => console.log("Pressed")}
                            >
                                <Image
                                    source={icons.barMenu}
                                    resizeMode="contain"
                                    style={{
                                        width: 25,
                                        height: 25,
                                    }}
                                />
                            </TouchableOpacity>
                        ),
                    }}
                />

                <Stack.Screen
                    name="DestinationDetail"
                    component={DestinationDetail}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="LoginAs"
                    component={LoginAs}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="SignUp"
                    component={SignUp}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Login"
                    component={Login}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Cases"
                    component={Cases}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Cl_Cases"
                    component={Cl_Cases}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Cl_Review"
                    component={Cl_Review}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Cl_Chat"
                    component={Cl_Chat}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Cl_Dictionary"
                    component={Cl_Dictionary}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Cl_Hearings"
                    component={Cl_Hearings}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Cl_Lawyer"
                    component={Cl_Lawyer}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Cl_Profile"
                    component={Cl_Profile}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Cl_Reminder"
                    component={Cl_Reminder}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Lw_Cases"
                    component={Lw_Cases}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Lw_Profile"
                    component={Lw_Profile}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Lw_Reminder"
                    component={Lw_Reminder}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Lw_Requests"
                    component={Lw_Requests}
                    options={{ headerShown: false }}
                />

                {/* Tabs */}
                < Stack.Screen
                    name="Client"
                    component={Tabs}
                    options={{
                        title: null,
                        headerStyle: {
                            backgroundColor: '#003f5c'
                        },
                        headerLeft: ({ onPress }) => (
                            <TouchableOpacity
                                style={{ marginLeft: SIZES.padding }}
                                onPress={onPress}
                            >
                                <Image
                                    source={icons.back}
                                    resizeMode="contain"
                                    style={{
                                        width: 25,
                                        height: 25,
                                    }}
                                />
                            </TouchableOpacity>
                        ),
                        headerTitle: () => ( <Text style={{ ...FONTS.h2 ,  color: "white"}}> Client Dashboard</Text>),
                        headerRight: () => (
                            <TouchableOpacity
                                style={{ marginRight: SIZES.padding }}
                                onPress={() => console.log("Menu")}
                            >
                                <Image
                                    source={icons.menu}
                                    resizeMode="contain"
                                    style={{
                                        width: 25,
                                        height: 25,
                                    }}
                                />
                            </TouchableOpacity>
                        ),
                    }}
                />


                {/* Tabs */}
                < Stack.Screen
                    name="Lawyer"
                    component={Lawyer}
                    options={{
                        title: null,
                        headerStyle: {
                            backgroundColor: '#003f5c'
                        },
                        headerLeft: ({ onPress }) => (
                            <TouchableOpacity
                                style={{ marginLeft: SIZES.padding }}
                                onPress={onPress}
                            >
                                <Image
                                    source={icons.back}
                                    resizeMode="contain"
                                    style={{
                                        width: 25,
                                        height: 25,
                                    }}
                                />
                            </TouchableOpacity>
                        ),
                        headerTitle: () => ( <Text style={{ ...FONTS.h2 ,  color: "white"}}> Lawyer Dashboard</Text>),
                        headerRight: () => (
                            <TouchableOpacity
                                style={{ marginRight: SIZES.padding }}
                                onPress={() => console.log("Menu")}
                            >
                                <Image
                                    source={icons.menu}
                                    resizeMode="contain"
                                    style={{
                                        width: 25,
                                        height: 25,
                                    }}
                                />
                            </TouchableOpacity>
                        ),
                    }}
                />
            </Stack.Navigator>
        </NavigationContainer >
    );
};

export default () => {
    return <App />;
};
